"use strict";$(function(){$(".btn-more-videos").click(function(){let n=$(this).parents(".row:first");n.addClass("d-none");n.siblings(".more-videos:first").removeClass("d-none");n.siblings(".less-videos-trigger:first").removeClass("d-none")});$(".btn-less-videos").click(function(){let n=$(this).parents(".row:first");n.addClass("d-none");n.siblings(".more-videos:first").addClass("d-none");n.siblings(".more-videos-trigger").removeClass("d-none")})});